import React, {useState} from 'react'
import './ContactBtn.css'

function ContactBtn() {
    const [click, setClick] = useState(false);

    const handleClick = () => setClick(!click);

    return (
        <>
            <div className='black' onClick={handleClick}>
                Kontakt
            </div>
            <div className={click ? 'hide' : 'contact-details'}>
                Mariusz Kud≈Çacz<br/>
                mail@mail.pl
            </div>
        </>
    )
}

export default ContactBtn
